                total = prefix[i][j] - prefix[i * mid][j] - prefix[i][j - mid] + prefix[i - mid][j - mid]
                if isLower and total <= threshold or (not isLower and total >= threshold):
                    return True
        return False
    (l, r) = (1, min(m, n) + 1)
    (upper, lower) = (0, 0)
    while l < r:
        mid = l + (r - l) // 2
        if check(mid, upperThreshold, True):
            l = mid + 1
            upper = mid
        else:
            r = mid
    (l, r) = (1, min(m, n) + 1)
    while l < r:
        mid = l + (r - l) // 2
        if check(mid, lowerThreshold, False):
            r = mid
            lower = mid
        else:
            l = mid + 1
    return [upper, lower]
